import React,{useState} from 'react'
import {Form,Button} from "react-bootstrap";
import Axios from "axios";
function Profile() {


 const [lista, setlist] = useState([]);


 const getData = () => {
    Axios.get('https://tutorial4-api.herokuapp.com/api/users/').then((response)=>{
        console.log(response.data.data);
         setlist(response.data.data);
      });
  }  

    return (
        <div>
            <Form >
                        <Form.Label className="Login-Header">Profile Page</Form.Label>
                        <div>
                            <Button onClick={getData}>click me</Button>
                        </div>
                        <div>
                            {lista.map((val,key)=>{
                                return( 
                                            <div className="container-wrapper-profile"><div>{val.id}</div>
                                                <div>{val.firstName} {val.lastName}</div>
                                                <div>{val.email}</div>
                                                <img src={val.picture}/>
                                             </div>
                            )})}
                            </div>
            </Form>
        </div>
    )
}

export default Profile
